inor translation fixes<br />\n- Extension update notifications switched to disabled by default<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(193,3,'2009-01-29 13:00:00','Unirgy_Giftcert release 0.8.2','- Fixed printing invoices with GCs in admin sales orders grid<br />\n- Fixed showing correct GC numbers to multiple recipients in the same order<br />\n- Fixed incorrect virtual status of shopping cart<br />\n- Fixed ignoring custom message text in new order email if none entered (please update your custom transactional emails)<br />\n- Added send virtual card to self<br />\n- Added configuration for custom message preview<br />\n- Added frontend amount input configuration (range, dropdown, fixed, any amount)<br />\n- Added showing minimal price in product list<br />\n- Added \"Expire On\" default timespan<br />\n- Added expiration date on balance check page and in email templates<br />\n- Added showing GC total line in frontend > my account > order view, new order email, order print<br />\n- Added product view javascript and simplified initial layout<br />\n<br />\nChanged theme files:<br />\n- template/unirgy/giftcert/product/type.phtml<br />\n- template/unirgy/giftcert/product/media.phtml<br />\n- template/unirgy/giftcert/balance.phtml<br />\n- layout/ugiftcert.xml<br />\n<br />\nNew theme files:<br />\n- (*) template/unirgy/giftcert/order/total.phtml<br />\n1. edit template/sales/order/items.phtml and template/sales/order/print.phtml<br />\n2. add before Grand Total: <?php echo $this->getChild(\'ugiftcert_total\')->setColspan($colspan)->toHtml() ?><br />\n3. edit template/email/order/items.phtml<br />\n4. add before Grand Total: <?php echo $this->getChildHtml(\'ugiftcert_total\') ?><br />\n<br />\nThis is an extensive upgrade, please test rigorously.<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(194,3,'2009-02-01 13:00:00','Unirgy_Giftcert release 0.8.3','- Fixed JS Error (print is null) when sending by post is disabled<br />\n- Fixed free amount entry (empty amount_config) configuration<br />\n- Added sending GC emails from admin (GC grid massaction)<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(195,3,'2009-02-19 13:00:00','Unirgy_Giftcert release 0.8.5','- Fixed handling non-US date formats for GC expiration dates<br />\n- Fixed ugiftcert_amount_config attribute to be not required<br />\n- Added configurable PIN format in email confirmations<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(196,3,'2009-02-19 13:00:00','Unirgy_Giftcert release 0.8.4','This release focused mostly on handling GCs and multiple currencies.<br />\n<br />\n- Fixed unlimited message length<br />\n- Fixed GC grid filter by status<br />\n- Fixed getting GC amount configuration from product attribute in catalog product list<br />\n- Fixed logic working with multiple currencies<br />\n- Fixed error message when sending emails generated in admin<br />\n- Added different GC amount configuration per currency<br />\n- Added purchasing GC amount and using GC balance in customer\'s currency<br />\n- Added automatically generated product attribute for amount configuration (add to your attribute sets manually)<br />\n- Added new GC confirmation emails on payment completion (thanks to Vincent [vmaillot])<br />\n- Added changing GC status to Active on payment completion<br />\n<br />\nChanged theme files:<br />\n- layout/ugiftcert.xml - show correct price on product list pages<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(197,3,'2009-04-04 13:00:00','Unirgy_Giftcert release 0.9.0','- Added compatibility with Magento 1.3<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(198,3,'2009-04-20 14:00:00','Unirgy_Giftcert release 0.9.1.1','- Fixed removal of GCs from cart.<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(199,3,'2009-04-20 14:00:00','Unirgy_Giftcert release 0.9.1','- Added tax class attribute for GC products.<br />\n- Added removal of GCs from cart.<br />\n- Added collapsed/expanded view of GCs in cart totals.<br />\n- Fixed showing GCs as negative in cart totals.<br />\n- Removed ambiguous letters from GC number and PIN.<br />\n<br />\nNew theme files: IMPORTANT, COPY TO YOUR THEME:<br />\n- template/unirgy/giftcert/checkout/total.phtml<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(200,3,'2009-05-11 14:00:00','Unirgy_Giftcert release 0.9.2','- Fixed Paypal Standard amount when GC is used.<br />\n- Fixed refunding GC on order cancel (including PayPal Standard/Express edit order).<br />\n- Fixed remembering GC codes in cart when just logged in customer\'s cart is merged.<br />\n- Fixed invoicing orders with GC balance for correct amount.<br />\n- Added use of GC in admin created orders.<br />\n- Added GC store property for proper locale configuration per GC.<br />\n- Added capability to send emails for GCs created in admin.<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(201,3,'2009-05-17 14:00:00','Unirgy_Giftcert release 0.9.3','- Minor fix to allow compatibility with Magento 1.1.6+<br />\n- Fixed activating and sending new GC email notifications on online payment methods<br />\n- Fixed GC currency code for admin created orders<br />\n- Added setting emailed virtual cards as shipped, allowing marking the virtual order as complete<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(202,3,'2009-06-04 14:00:00','Unirgy_Giftcert release 0.9.4','- Added {{var sender_name}} in email template to show full name of the sender<br />\n- Changed default email template to include sender_name instead of sender_firstname<br />\n- Added \"product\" variable in email, to allow GC product attributes, such as {{var product.getImageUrl()}}<br />\n- Updates for Magento 1.3.x compatibility, including fix of invalid price in category listing<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(203,3,'2010-02-24 13:00:00','Unirgy_Giftcert release 0.9.5','  * Fixed adding GC products in admin created orders<br />\n  * Fixed double calculation of GCs in cart (courtesy of John)<br />\n  * Fixed duplicate certificate number bug (courtesy of Sofasurfer)<br />\n  * Enabled \"weight\" attribute for GC products to allow different shipping rates<br />\n  * Updates for Magento 1.3.2.x compatibility for some configurations<br />\n  * Added ja_JP translation (courtesy of rodrigo423)<br />\n  * Added pt_PT translation (courtesy of atonefer)<br />\n  * Added it_IT translation (courtesy of Roberto P.)<br />\n  * Added configuration for GC to always be a virtual product<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(204,3,'2010-02-25 13:00:00','Unirgy_Giftcert release 0.9.6','  * Fixed DB upgrade for CE 1.4<br />\n<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(205,3,'2010-03-31 13:00:00','uGiftcert release 0.9.10','  * Fixed compatibility with CE 1.4','http://www.unirgy.com/products/ugiftcert',0,1),(206,3,'2010-04-01 01:00:00','uGiftcert release 0.9.11','  * Fixed compatibility with CE 1.4 for orders fully paid by GC','http://www.unirgy.com/products/ugiftcert',0,1),(207,3,'2010-04-01 03:00:00','uGiftcert release 0.9.12','  * Fixed adding GC totals on customer frontend order view and emails','http://www.unirgy.com/products/ugiftcert',0,1),(208,3,'2010-04-07 14:00:00','uGiftcert release 0.9.13','  * Fixed backward compatibility with Magento 1.3.2.4','http://www.unirgy.com/products/ugiftcert',0,1),(209,3,'2010-04-12 14:00:00','uGiftcert release 0.9.14','  * Fixed PayPal redirect URL for 1.4.0.1','http://www.unirgy.com/products/ugiftcert',0,1),(210,3,'2010-09-29 14:00:00','uGiftcert release 0.9.17','==== 0.9.17 ====<br />\n  * Fixed handling multi-address checkout, possible other issues<br />\n<br />\n==== 0.9.16 ====<br />\n  * Added custom email templates per GC product<br />\n<br />\n==== 0.9.15 ====<br />\n  * Compatibility with Magento CE 1.4.x<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(211,3,'2011-06-30 14:00:00','uGiftCert 0.9.20','==== 0.9.20 ====<br />\n  * Fixed compatibility with CE 1.5.0.1 and EE 1.10.0.1<br />\n<br />\n==== 0.9.19 ====<br />\n  * Fixed foreign keys when Magento tables have local prefix<br />\n<br />\n==== 0.9.18 ====<br />\n  * Fixed completing orders when fully paid by GC<br />\n  * Fixed error during manual sending of GC email notification<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(212,3,'2011-07-06 14:00:00','uGiftCert 1.0.0','===== 1.0.0 =====<br />\n  * Added external API interface<br />\n  * Added PDF printout option<br />\n  * Added conditions for gift certificates<br />\n  * Added \'Save and Send\' button<br />\n  * Added editing GC product after it has been added to cart, preserves previously configured values<br />\n  * Changed, remove order id field when admin creates certificate<br />\n  * Fixed compatibility with CE 1.5.1 and CE 1.6rc1<br />\n  * Fixed problem with payment method display when order is fully covered by GC<br />\n  * Fixed PayPal express error, amount mismatch<br />\n  * Fixed PayPal standard error, discount not transferred<br />\n  * Fixed Authorize.net error, discount not transferred<br />\n  * Fixed Configuring certificate to use currency other than configured currencies triggers fatal error','http://www.unirgy.com/products/ugiftcert',0,1),(213,3,'2011-07-20 14:00:00','uGiftCert 1.0.1','===== 1.0.1 =====<br />\n  * Added OnestepCheckout observer, supporting OnestepCheckout extension<br />\n  * Added convenience method for removing certificate from quote.<br />\n  * Fixed update checkout payment methods to work with 1.4, 1.6rc1 as well.<br />\n  * Fixed some checks added to make sure _title() controller method exists. 1.3 compatibility fix<br />\n  * Fixed added try catch block for PDF download link, up until 1.4.1 there is no Varien Link element<br />\n  * Fixed added method_exist check to PDF settings form, fix for Magento before 1.4.2<br />\n  * Fixed PDF page size for older ZF PDF versions. <br />\n  * Fixed paypal checkout for Magento version 1.4.1.1 and earlier','http://www.unirgy.com/products/ugiftcert',0,1),(214,3,'2011-08-14 14:00:00','uGiftCert 1.1.0','===== 1.1.0 =====<br />\n  * Added import capabilities.<br />\n  * Fixed PDF draw text error<br />\n<br />\n===== 1.0.2 =====<br />\n  * Fixed PDF settings page for Magento 1.4.0.1 and earlier<br />\n  * Fixed fatal error of non existing Link form element.<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(215,3,'2012-03-19 13:00:00','uGiftCert 1.2.0','===== 1.2.0 =====<br />\n  * Updated license handling to support Unirgy Installer<br />\n<br />\n===== 1.1.4 =====<br />\n  * added an option to set allowed domains, this allows to have module not interfere with multiple domains on the same installation<br />\n  * added global override checkbox for PDF settings on certificate and product level<br />\n  * added strftime formatting option for expire_at field<br />\n  * fixed pdf printout text positioning<br />\n  * fixed pdf printout font variants<br />\n  * fixed email issue when adding user to history<br />\n  <br />\n===== 1.1.3 =====<br />\n  * Improved pdf settings page<br />\n  * Added pdf settings to each certificate<br />\n  * Added pdf settings when creating certificates, allowing to batch set PDF settings<br />\n  * Added conditions settings when creating certificates<br />\n  * Added pdf settings to gift certificate products, all certificates from that product inherit them<br />\n  * Added conditions settings to gift certificate products, all certificates from that product inherit them<br />\n  * Updated us locale file.<br />\n  * added ability to capture orders when paid completely with certificates<br />\n  * added conditions check upon each time cart page is reloaded, to avoid breaking conditions after certificate is applied<br />\n  * fixed issues with One step checkout module<br />\n  * fixed some translation calls to other modules that were not correct<br />\n  * fixed error when using one fixed amount for certificate, it was being converted to integer always<br />\n  <br />\n===== 1.1.2 =====<br />\n  * Fix layered navigation with negative prices.<br />\n  * Added minimal possible price to product.<br />\n  * Fix showing Gift Certificate total even when no GC used<br />\n  * Fix customer frontend invoice details do not show GC used information<br />\n  * Fix, when purchasing multiple certificates of same kind, only one PDF is sent<br />\n  * Fix, changed PDF settings fieldset name construction<br />\n  * Fix, typos in some files<br />\n  * Fix, OnestepObserver, was preventing non certificates to be used<br />\n  * Fix, sidebar cart block shows total 0 with giftcerts<br />\n  * Improvement, cleaned up some code in Observer.php<br />\n  * Fix, filtering by certificate ID is causing an error.<br />\n  * Fix, wrong setup resource string used in sql update file<br />\n  * Refactored email sending process<br />\n  * Fixed faulty logic for PDFs<br />\n  * Changed install file','http://www.unirgy.com/products/ugiftcert',0,1),(216,3,'2013-06-19 14:00:00','uGiftCert 2.0.7','===== 2.0.7 =====<br />\n  * fixed refund process when there are certificates involved<br />\n  * fixed non working report export<br />\n  * fixed wrong setup string<br />\n  * changed grid export to match import column headers<br />\n===== 2.0.6 =====<br />\n  * added option to disable coupon usage on per certificate base<br />\n  * fixed bug in onestep observer<br />\n  * made some UI changes<br />\n===== 2.0.5 =====<br />\n  * added some events to import process<br />\n===== 2.0.4 =====<br />\n  * Fixed potential order failure if expire days are too many, instead of throwing exception, set date to null, which is forever<br />\n  * Fixed send on bug that will send already sent certificates<br />\n  * fixed bug when scheduled certificates have no amount.<br />\n===== 2.0.3 =====<br />\n  * Fixed small bugs and typos<br />\n  * Added set customerGroups to cert model<br />\n  * Changed logic of removing certificate codes, not to throw an exception.<br />\n  * Changed default values for some settings to be enabled, removed unused setting fields.<br />\n  * updated en_US csv file.<br />\n  * updated some product page styles to match default ones<br />\n  * changed some code to add more 1.4.1.1 compatibility<br />\n  * fixed send on save algorithm<br />\n  * Updated locale file to include all strings<br />\n  * fixed SQL foreign key error when saving certificate<br />\n  * changed error messages for PDF preview not to raise exceptions<br />\n===== 2.0.2 =====<br />\n  * fixed potential bug in update file 1.2.2, it affects installations which miss \'default\' product attribute set<br />\n  * fixed possible injection bug caused by non escaped custom options values in Magento admin<br />\n  * restored ability to show only enabled delivery option (either email, post or both)<br />\n  * fix for bad formatted xml in config.xml, it caused exception when rendering invoice and credit memo totals<br />\n  * fix, updated frontend and server validation for posted data<br />\n===== 2.0.1 =====<br />\n  * fixed bug with installer for older Magento rleases<br />\n  * fixed bug in email scheduling<br />\n===== 2.0.0 =====<br />\n  * added option to disallow coupons alongside certificates<br />\n  * fixed option to use certificate only on the store from which it was bought<br />\n  * fixed, refunded orders now restore certificate amounts<br />\n  * added option to limit certificate usage to specific customer group<br />\n  * added option to schedule sending, now customer can choose when to send purchased certificate email<br />\n  * added dedicated certificate input box, it can be used next to coupons box. It has to be manually added to cart template<br />\n  * added option to configure url for balance check page<br />\n  * added certificate usage reports<br />\n  * fixed multiple small issues<br />\n  * added option for each gift product or certificate to have their own email template, certificate inherit product settings<br />\n  * changed how PDF settings are used. Now same PDF template can be assigned to multiple certificates.<br />\n===== 1.2.3 =====<br />\n  * fixed a bug for 1.6.2, which causes a block to be rendered in email template<br />\n  * Fix a bug in 1.7, when retrieving media path<br />\n  * fixed bug with quote endless loop if anything triggers collect totals during quote load<br />\n===== 1.2.2 =====<br />\n  * fixed bug with getConditions method not found<br />\n  * added experimental option to exclude some totals from gift certificate coverage (shipping, tax etc)<br />\n===== 1.2.1 =====<br />\n  * fixed PDF website/store level configuration problem<br />\n  * fixed notices of undefined indexes in some occasions<br />\n  * fixed a bug with empty initial PDF settings,like after import<br />\n  * added auto disabling PDF form inputs when use default is checked.<br />\n  * fixed a bug, where added comments are not listed in history tab. Also a bug when certificate id is actually its code<br />\n','http://www.unirgy.com/products/ugiftcert',0,1),(217,4,'2008-11-07 17:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,0,1),(218,4,'2013-12-13 04:29:25','Make your shopping as fast as lighting with Ajax Pro 3.0','Ajax Pro 3.0 is now available with next new features:\n\n- Improved ajax update algorithm \n- Allows to show shopping cart, coupon code block and related products block in ajax cart window\n- Configurable list of blocks for ajax refresh for each action\n- Improved ajax progress window\n- Improved usability for add to cart and add to compare ajax action\n- Improved modal window script\n','http://goo.gl/0ces1y',0,1),(219,4,'2013-12-16 04:20:50','Create attractive landing pages and improve store navigation with Magento Brands and Attributes pages extension!',NULL,'http://goo.gl/yp998j',0,1),(220,4,'2008-11-07 17:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,0,1),(221,4,'2008-11-07 17:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,0,1),(222,4,'2013-12-20 04:32:25','Improve traffic from search engines to your Magento store with Google Rich snippets 1.3.0',' Rich snippets 1.3.0 is now available with next new features:\n\n-  Added Google+ Author feature support\n-  Added Breadcrumbs feature support\n-  Resources moved to base folder\n','http://goo.gl/PY54Zf',0,1),(223,4,'2008-11-07 17:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,0,1);
