INSERT INTO `seosuite_template` VALUES (1,'product_name','Product Name Template','<b>Template variables</b>\r\n<p>[attribute] — e.g. [name], [price], [manufacturer], [color] — will be replaced with the respective product attribute value or removed if value is not available\r\n<p>[attribute1|attribute2|...] — e.g. [manufacturer|brand] — if the first attribute value is not available for the product the second will be used and so on untill it finds a value\r\n<p>[prefix {attribute} suffix] or\r\n<p>[prefix {attribute1|attribute2|...} suffix] — e.g. [({color} color)] — if an attribute value is available it will be prepended with prefix and appended with suffix, either prefix or suffix can be used alone\r\n<p>Additional variables available for Product Meta Title and Description only: [category], [categories], [store_name], [website_name]\r\n<p>\r\n<p>\r\n<b>Examples</b>\r\n<p>Product URL Key\r\n<p>[name] [by {manufacturer|brand}] [{color} color] [for {price}] will be transformed into\r\n<p>htc-touch-diamond-by-htc-black-color-for-517-50\r\n<p><b>Product Meta Title</b>\r\n<p>[name] [by {manufacturer|brand}] [({color} color)] [for {price}] [in {categories}] will be transformed into\r\n<p>HTC Touch Diamond by HTC (Black color) for € 517.50 in Cell Phones - Electronics',0),(2,'product_url','Product URL Keys','<b>Template variables</b>\r\n<p>[attribute] — e.g. [name], [price], [manufacturer], [color] — will be replaced with the respective product attribute value or removed if value is not available\r\n<p>[attribute1|attribute2|...] — e.g. [manufacturer|brand] — if the first attribute value is not available for the product the second will be used and so on untill it finds a value\r\n<p>[prefix {attribute} suffix] or\r\n<p>[prefix {attribute1|attribute2|...} suffix] — e.g. [({color} color)] — if an attribute value is available it will be prepended with prefix and appended with suffix, either prefix or suffix can be used alone\r\n<p>\r\n<p><b>Examples</b>\r\n<p>Product URL Key\r